import React from 'react'
import { Text, TextInput, View, StyleSheet } from 'react-native'
import Buttons from '../components/button/Buttons';

function Home() {

    const test = () => {
        console.log('valorr')
    }

    return (
        <View>
            {/* <View>
                <Text>
                    35 + 5
                </Text>
                <Text>
                    = 40
                </Text>
            </View>
            <View>
                <Text>
                    result
                </Text>
            </View>

            <View>
                <Text>
                    botoes
                </Text>
            </View> */}

            <Buttons icon='test' onClick={test} />
        </View >
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
});

export default Home
